post.description:
Creates time clock event instances for the specified workers.

In the request body, specify at least these required fields: worker, eventType, dateTime, and timeZone.

The request cannot include more than one of these mutually exclusive fields: timeEntryCode, project, or projectPlanTask.

Worker time attestations must be created before adding the time clock event, if applicable. For more information on Time Attestations, see Setup Considerations: Time Attestations in the Admin Guide.

Sample Request:
```
{
  "worker": {
    "id": "workerWID"
  },
  "eventType": {
    "id": "3b6121e8f9804d6ab0065ebe212fc0fe"
  },
  "dateTime": "2024-01-22T08:00:00.000",
  "timeZone": {
    "id":"dc10e1b4446c11de98360015c5e6daf6"
  },
  "timeEntryCode": {
    "id": "timeEntryCodeWID"
  }
}
```

<b>Secured by:</b> Process: Time Clock Event REST API's

<b>Scope:</b> Time Tracking
